$(".todolist-save").on("click",function(){var b=$("#todolistTitle").val();var a=$(this).data("url");$.ajax({url:a,type:"POST",data:{title:b},success:function(c){$("ul.todo-list").html(c)}})});$(".todolistCheck").on("change",function(){if(this.checked){$.ajax({url:url,type:"POST",data:{id:$(this).val()},success:function(a){$("ul.todo-list").html(a)}})}});